import './App.css';
import React from 'react';
import Navigation from '../Navigation/navigation';
import Instructions from '../Instructions/instructions';
import DoorGame from '../DoorGame/doorGame';

class App extends React.Component {
  constructor(props){
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div>
        <Navigation />
        <Instructions />
        <DoorGame />
      </div>
    );
  }
}

export default App;
